import React, { Component } from 'react'

 class Note extends Component {
  render() {
    return (
      <div className="note-container">

        <Card>
            <CardBody>
                <CardTitle>{this.props.title}</CardTitle>
                <CardText> <MarkdownPreview value={this.props.content} />
                  </CardText>
            </CardBody>
        </Card>
      </div>
    )
  }
}

export default Note;
